import { text } from 'express'
import React from 'react'
export default function login() {
  return (
    <div class="login">
    Login
    <div class="form">
    <input type='text' id='username' placeholder='Username'>Username</input>
    <input type='password' id='password' placeholder='Password'>Password</input>

    </div></div>

  )
}
